import decisionTree from 'https://cdn.skypack.dev/decision-tree';
const btnSubmit = document.querySelector(".btn-submit");
const slider = document.querySelectorAll('.slider');
const value = document.querySelectorAll('.value')
const questionNumber = document.querySelectorAll(".question-number");
btnSubmit.addEventListener("click", checkans);
slider.forEach((element,index) => {
    element.addEventListener("change",()=> {
      questionNumber[index].style.backgroundColor = "#77DD77";
      value[index].textContent=element.value;
    });
    });

var ans = [];

function checkans() {

    var m = 5
    // console.log(n)
    for(let i=0;i<m;i++){
      var a = i + m;
      let b = Number(slider[i].value)
      let c = Number(slider[a].value)
      var sum = Math.round(( b+c )/2);
      ans.push(sum)
    }

    prediction(ans)
}


function prediction(ans) {
    var DecisionTree = decisionTree;
    var training_data = data()
    var test_data = data()
    var class_name = "Personality (class label)";
    var features = ["openness", "neuroticism", "conscientiousness", "agreeableness", "extraversion"];
    var dt = new DecisionTree(training_data, class_name, features);
    var predicted_class = dt.predict({
        "openness": ans[0],
        "neuroticism": ans[1],
        "conscientiousness": ans[2],
        "agreeableness": ans[3],
        "extraversion": ans[4],
    });
    var accuracy = dt.evaluate(test_data) * 100;
    accuracy = accuracy.toFixed(2);
    // localStorage.setItem('accuracy',accuracy);
    localStorage.setItem('fit',predicted_class);
}

